                </div>
                <div className='col-6'>
                    <h1>Largest stock broker in India</h1>
                    <p>2+ million Zerodha clients contribute to over 15% ao alll ratail order volumes in India daily by trading and inversting in:</p>
                    
                    <ul>
                        <li>Futures and Options</li>
                        <li></li>
                        <li></li>
                    </ul>
                </div>
            </div>
        </div>
     );
}

export default Awards;
